import {OrderList, OrderTitle, } from './Order.styled'

export default function Order({item}) {

return (
    <OrderList>
        <OrderTitle>{item.title}</OrderTitle>
        <img src={'./img/' + item.img} className="order_img"/>
        <p className="order_price">{item.price}$</p>
    </OrderList>
)

}
